import { IconButton } from "@material-ui/core";
import { Menu } from "@material-ui/icons";
import React, { Fragment } from "react";
import { useState } from "react";

type Anchor = "right";

const SideDrawer = () => {
  //   const [state, setState] = useState({ right: false }); // Add this
